selector_to_html = {"a[href=\"#equation-eq-model-med-residualer\"]": "<div class=\"math notranslate nohighlight\" id=\"equation-eq-model-med-residualer\">\n\\[    y_i = f(x_i) + z_i.\\]</div>", "a[href=\"#residualer\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">25.3. </span>Residualer<a class=\"headerlink\" href=\"#residualer\" title=\"Permalink til denne overskrift\">#</a></h1><p>Vi forts\u00e6tter med at betragte datas\u00e6ttet</p>", "a[href=\"#equation-eq-residualer\"]": "<div class=\"math notranslate nohighlight\" id=\"equation-eq-residualer\">\n\\[    z_i = y_i - f(x_i).\\]</div>", "a[href=\"#prov-selv\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">25.3.1.4. </span>Pr\u00f8v selv<a class=\"headerlink\" href=\"#prov-selv\" title=\"Permalink til denne overskrift\">#</a></h3>", "a[href=\"#residualernes-vigtige-rolle\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">25.3.1. </span>Residualernes vigtige rolle<a class=\"headerlink\" href=\"#residualernes-vigtige-rolle\" title=\"Permalink til denne overskrift\">#</a></h2><p>Residualerne er helt centrale, n\u00e5r det kommer til at skulle evaluere, hvor god vores model er p\u00e5 vores data. Vi kr\u00e6ver en bestemt opf\u00f8rsel af residualerne for at konkludere, at en model er god til at beskrive sammenh\u00e6ngen i vores data.</p>", "a[href=\"#residualerne-skal-have-konstant-varians\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">25.3.1.3. </span>Residualerne skal have konstant varians<a class=\"headerlink\" href=\"#residualerne-skal-have-konstant-varians\" title=\"Permalink til denne overskrift\">#</a></h3><p>N\u00e5r vi betragter residualplottet, s\u00e5 skal der gerne v\u00e6re en symmetri i residualerne rundt om <span class=\"math notranslate nohighlight\">\\(x\\)</span>-aksen. Vi vil gerne have, at residualerne varierer konstant rundt om <span class=\"math notranslate nohighlight\">\\(x\\)</span>-aksen og st\u00f8rrelsen af variationen skal v\u00e6re nogenlunde ens p\u00e5 tv\u00e6rs af alle observationerne <span class=\"math notranslate nohighlight\">\\(x_i\\)</span>. Dette kaldes homoskedacitet. Hvis variansen af residualerne stiger eller falder systematisk med <span class=\"math notranslate nohighlight\">\\(x_i\\)</span>, s\u00e5 vil det kunne ses som en tragt-form i residualplottet. Er dette tilf\u00e6ldet, s\u00e5 vil vi muligvis have brug for en anden model eller tage h\u00f8jde for den varierende varians p\u00e5 en anden m\u00e5de.</p>", "a[href=\"#residualerne-skal-vaere-sa-sma-som-muligt\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">25.3.1.1. </span>Residualerne skal v\u00e6re s\u00e5 sm\u00e5 som muligt<a class=\"headerlink\" href=\"#residualerne-skal-vaere-sa-sma-som-muligt\" title=\"Permalink til denne overskrift\">#</a></h3><p>Dette er n\u00e6rmest en selvf\u00f8lge. Husk, residualerne kaldes ogs\u00e5 fejlen. Vi \u00f8nsker, at forskellen mellem de faktisk observerede v\u00e6rdier <span class=\"math notranslate nohighlight\">\\(y_i\\)</span> og de pr\u00e6dikterede v\u00e6rdier <span class=\"math notranslate nohighlight\">\\(f(x_i)\\)</span> er minimal. Desto mindre fejlen er, desto t\u00e6ttere p\u00e5 modellen befinder vores faktiske v\u00e6rdier sig. Det var pr\u00e6cis det id\u00e9en var bag mindste kvadraters metode. Her s\u00e5 vi, hvordan vi ved at minimere summen af kvadraterne p\u00e5 de lodrette afstande mellem datapunkterne og linjen, kunne bestemme den linje, der bedst gik gennem vores data. Disse lodrette afstande er jo netop residualerne. Med andre ord, s\u00e5 g\u00e5r mindste kvadraters metode ud p\u00e5 at minimere summen af kvadraterne p\u00e5 residualerne. Det kan vi ogs\u00e5 se, hvis vi inds\u00e6tter <a class=\"reference internal\" href=\"#equation-eq-residualer\">(25.4)</a> i <a class=\"reference internal\" href=\"simpel-lineaer-regression.html#equation-eq-mindste-kvadraters-metode\">(25.3)</a></p>", "a[href=\"#residualerne-skal-vaere-tilfaeldige\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">25.3.1.2. </span>Residualerne skal v\u00e6re tilf\u00e6ldige<a class=\"headerlink\" href=\"#residualerne-skal-vaere-tilfaeldige\" title=\"Permalink til denne overskrift\">#</a></h3><p>Vi \u00f8nsker ikke, at der er et systematisk m\u00f8nster i residualerne. Dette unders\u00f8ger vi ved en visuel inspektion af residualerne i et residualplot. Et residualplot er blot et scatterplot, hvor vi plotter residualerne <span class=\"math notranslate nohighlight\">\\(z_i\\)</span> mod <span class=\"math notranslate nohighlight\">\\(x_i\\)</span> for alle vores datapunkter <span class=\"math notranslate nohighlight\">\\(i=1,2,\\dots,n\\)</span>. Hvis der er et m\u00f8nster i residualplottet, betyder det, at vores model ikke fanger alle strukturerne i dataene. Det vil oftest betyde, at vi har brug for en mere kompleks model.</p>", "a[href=\"simpel-lineaer-regression.html#equation-eq-mindste-kvadraters-metode\"]": "<div class=\"math notranslate nohighlight\" id=\"equation-eq-mindste-kvadraters-metode\">\n\\[    \\text{RSS} = (y_1 - f(x_1))^2 + (y_2 - f(x_2))^2 + \\cdots + (y_n - f(x_n))^2 = \\sum_{i=1}^n (y_i - f(x_i))^2,\\]</div>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(` ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,
                onShow(instance) {MathJax.typesetPromise([instance.popper]).then(() => {});},
            });
        };
    };
    console.log("tippy tips loaded!");
};
